import { USER_DETAILS } from "../actions/types";

const initialState={
    userinfo:"null"
}

const UserDetailsReducer=(state=initialState,action)=>{
    const newState={...state}
    switch(action.type){
        case USER_DETAILS:
            newState.userinfo=action.payload
            break;
        default:
            return newState;
    }
    return newState;
}
export default UserDetailsReducer;
